import React from "react";
import DashboardHeader from "../components/DashboardHeader";
import DashboardFooter from "../components/DashboardFooter";

const DashboardLayout = ({ children }) => {
    return (
        <>
            <DashboardHeader />
            <main>{children}</main>
            <DashboardFooter />
        </>
    );
};

export default DashboardLayout;
